CREATE TABLE SalesData (
    SaleID int PRIMARY KEY,
    CustomerID VARCHAR(50),
    SubcatID INT,
    EmployeeID INT,
    SaleDate DATE,
    Quantity INT,
    TotalPrice DECIMAL(10, 2),
    FOREIGN KEY (CustomerID) REFERENCES Customers(CustomerID),
    FOREIGN KEY (SubcatID) REFERENCES Subcategories(SubcatID),
    FOREIGN KEY (EmployeeID) REFERENCES Employees(EmployeeID)
);



Select * from
(select sales.SaleID,
sales.CustomerID,
sales.SubcatID,
sales.EmployeeID,
sales.SaleDate,
sales.Quantity,
sales.Quantity*subcategories.UnitPrice as Total
from sales
join subcategories
on sales.SubcatID = subcategories.SubcatID
order by sales.SaleDate) t ;

DROP table sales;


